INSERT INTO `node_revision__body` VALUES ('page',0,1,1,'en',0,'<h1>Terms of Service (\"Terms\")</h1>\r\n\r\n<p>Last updated: November 14, 2018</p>\r\n\r\n<p>Please read these Terms of Service (\"Terms\", \"Terms of Service\") carefully before using the d8.test website (the \"Service\") operated by Drupal Test Task (\"us\", \"we\", or \"our\").</p>\r\n\r\n<p>Your access to and use of the Service is conditioned on your acceptance of and compliance with these Terms. These Terms apply to all visitors, users and others who access or use the Service.</p>\r\n\r\n<p>By accessing or using the Service you agree to be bound by these Terms. If you disagree with any part of the terms then you may not access the Service. This Terms of Service agreement for Drupal Test Task.</p>\r\n\r\n<h2>Accounts</h2>\r\n\r\n<p>When you create an account with us, you must provide us information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the Terms, which may result in immediate termination of your account on our Service.</p>\r\n\r\n<p>You are responsible for safeguarding the password that you use to access the Service and for any activities or actions under your password, whether your password is with our Service or a third-party service.</p>\r\n\r\n<p>You agree not to disclose your password to any third party. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.</p>\r\n\r\n<h2>Links To Other Web Sites</h2>\r\n\r\n<p>Our Service may contain links to third-party web sites or services that are not owned or controlled by Drupal Test Task.</p>\r\n\r\n<p>Drupal Test Task has no control over, and assumes no responsibility for, the content, privacy policies, or practices of any third party web sites or services. You further acknowledge and agree that Drupal Test Task shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with use of or reliance on any such content, goods or services available on or through any such web sites or services.</p>\r\n\r\n<p>We strongly advise you to read the terms and conditions and privacy policies of any third-party web sites or services that you visit.</p>\r\n\r\n<h2>Termination</h2>\r\n\r\n<p>We may terminate or suspend access to our Service immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach the Terms.</p>\r\n\r\n<p>All provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.</p>\r\n\r\n<p>We may terminate or suspend your account immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach the Terms.</p>\r\n\r\n<p>Upon termination, your right to use the Service will immediately cease. If you wish to terminate your account, you may simply discontinue using the Service.</p>\r\n\r\n<p>All provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.</p>\r\n\r\n<h2>Governing Law</h2>\r\n\r\n<p>These Terms shall be governed and construed in accordance with the laws of Washington, United States, without regard to its conflict of law provisions.</p>\r\n\r\n<p>Our failure to enforce any right or provision of these Terms will not be considered a waiver of those rights. If any provision of these Terms is held to be invalid or unenforceable by a court, the remaining provisions of these Terms will remain in effect. These Terms constitute the entire agreement between us regarding our Service, and supersede and replace any prior agreements we might have between us regarding the Service.</p>\r\n\r\n<h2>Changes</h2>\r\n\r\n<p>We reserve the right, at our sole discretion, to modify or replace these Terms at any time. If a revision is material we will try to provide at least 30 days notice prior to any new terms taking effect. What constitutes a material change will be determined at our sole discretion.</p>\r\n\r\n<p>By continuing to access or use our Service after those revisions become effective, you agree to be bound by the revised terms. If you do not agree to the new terms, please stop using the Service.</p>\r\n\r\n<h2>Contact Us</h2>\r\n\r\n<p>If you have any questions about these Terms, please contact us.</p>\r\n','','full_html'),('article',0,2,2,'en',0,'<p>A <strong>test article</strong> is a version of space craft or related vehicle or equipment, built as a platform to perform testing. Test articles are built to the same specifications to replicate conditions and behaviors of flight ready versions. Test article version are also built without the certification and quality control steps taken with the versions intended for flight. Test articles are more complete than a boilerplate.</p>\r\n\r\n<p>Test articles can sometimes be upgraded to flight ready status. Of the 136 Space Shuttle external fuel tanks produced, one was retained as a test article. The contractor producing the tanks commented that that tank could be refurbished for flight use if necessary. The static test article for the Dream Chaser lifting-body spaceplane \"will become the atmospheric flight test vehicle in 2012 for drop tests.\"</p>\r\n\r\n<p>Test articles are often displayed in museums because of their accuracy. Museums may refurbish test articles to match more modern configurations. This was completed on the Hubble Space Telescope Structural Dynamic Test Vehicle on display at the National Air and Space Museum where this 1976 version of the vehicle was removed from display and upgraded in 1996 by the Smithsonian, Lockheed, and NASA to incorporate changes made on the on-mission version of the Hubble Space Telescope over several servicing missions.</p>\r\n','','basic_html'),('news',0,3,3,'en',0,'<p>Whenever any highly anticipated blockbuster is around the corner, itâ€™s only expected that promotional posters be plastered&nbsp;in movie theaters and entertainment stores, or even on social media. In the case of one as huge as <em><strong>Avengers: Infinity War</strong></em>, it comes as no surprise that the onslaught be seemingly never-ending.</p>\r\n\r\n<p>On the plus side, though, it gives fans a variety of options for which posters theyâ€™d like to grace their own walls. I mean, just because you may love one piece gathering Earthâ€™s Mightiest Heroes doesnâ€™t mean that itâ€™ll appeal to the next person.</p>\r\n\r\n<p>Or, if group shots arenâ€™t quite your thing, then you may dig character posters that allow each individual to have their time in the spotlight. And, if you are indeed of this crowd, well, then youâ€™ll like the latest offerings to have surfaced,&nbsp;as Marvelâ€™s now given Peter Parker and Tony Stark their own one-sheets â€“ both of which can be seen in the gallery below.</p>\r\n','','basic_html'),('post',0,4,4,'en',0,'<p>Transitional spaces in the home can be among the hardest spots to decorate and are often forgotten in terms of window coverings.</p>\r\n\r\n<p>With so many options to choose from, selecting window treatments can be a challenge. Different rooms call for different styles of window coverings - it\'s not a one-size fits all approach.</p>\r\n\r\n<p>Here at Somfy, we pride ourselves on making your life simpler, including helping you&nbsp;choose the right window coverings for your home. With that in mind, we\'ve created a ten-part series to help you choose the best window coverings to suit each room of your home.</p>\r\n\r\n<h2>Part Nine: Transitional Spaces</h2>\r\n\r\n<p>Transitional spaces in the home can be among the hardest spots to decorate and are often forgotten in terms of window coverings. If you are lucky enough to have windows in these spaces, we are here to help.</p>\r\n\r\n<p>Big and wide windows in these spaces are perfect for expanding the size of the space to the eye. For example, windows in the hallway can dramatically open up an otherwise tight space.</p>\r\n\r\n<p>Unfortunately, windows in these spaces are often left naked and bare as it can be difficult to find a solution to suit, but these tricky spaces need quality window coverings as well! Uncovered windows leave your furnishings exposed to UV damage, extreme heat or cold and consquently&nbsp;increased energy bills.</p>\r\n\r\n<p>In this month\'s blog, we look at three common transitional spaces and how you can choose window coverings to suit.</p>\r\n\r\n<h3>Entryways and Hallways</h3>\r\n\r\n<p>First impressions are everything and your entryway is no exception. It sets the tone for the rest of your home so you want to create a soothing and inviting atmosphere. Similarly, a hallway should create a special moment as you are lead from one room to another. The type of window treatment you should use depends on the type of window you have in this space.&nbsp;</p>\r\n\r\n<p>Many void spaces swap solid walls for windows which open the space and create appeal by taking advantage of the view outside. This presents an insulation problem as heat can escape in the winter and enter the home during the summer.</p>\r\n\r\n<p>Sidelight windows beautifully complement your entryway but extend a lack of privacy, with nosy neighbours able to peek inside your home.</p>\r\n\r\n<p>In this space, sheer treatments can combat the problems, offering light control and privacy without completely blocking the sun. Additionally, if the windows in your entryway sit above the door,&nbsp;motorised blinds are the optimal solution, with the ability to control them from wherever you are in the world.</p>\r\n\r\n<h3>Stairwell</h3>\r\n\r\n<p>Voids in stairwells open the home to a flood of natural light. They are particularly useful in areas of the home which may otherwise be lacking light. Large windows in voids can create a dramatic focal point and effortlessly enhance the space.</p>\r\n\r\n<p>However, uncovered windows can create heat pockets on your stairway during summer and cold during winter which will have your heating/cooling system working overime.</p>\r\n\r\n<p>In this space,&nbsp;external venetian blinds&nbsp;are a great solution, having a major impact on the temperature loss/gain. Motorised external venetians allow you to precisely control the amount of sunlight coming in and reducing glare. Venetians are also a good option for privacy protection as the slats can be angled to prevent people from seeing in!</p>\r\n\r\n<h3>Skylights</h3>\r\n\r\n<p>Skylights provide spectacular views and an abundance of natural light while also adding a magical design element to your home. They are a sleek way to open up a space but can be a source of unwanted heat.&nbsp;</p>\r\n\r\n<p>Excessive heat gain in summer and glare can be major problems, leaving you wishing you could turn your skylights off! They can also pose tricky problems for window coverings due to their location, shape and angle. However, it is easy to enjoy benefits of skylights all year round with external blinds.</p>\r\n\r\n<p>External blinds allow you to control the amount of light coming in and the temperature of your room, all while reducing energy consumption and costs. Most importantly, external blinds block the elements&nbsp;before&nbsp;they reach the window. Don\'t worry, this doesn\'t mean you will have to climb up on your roof to close the blind. Somfy motorisation means you can control your blinds using a remote, sensors, timers,&nbsp;a smartphone app or even your voice!</p>\r\n\r\n<h2>Recommendations</h2>\r\n\r\n<p>Windows in transitional spaces are the ultimate way to elevate dark interiors. However, it is important to provide insulation with window treatments to avoid precious heat loss or unwanted heat gain. Roller blinds or venetian blinds are great options for these transitional spaces allowing you to maintain a steady flow of light, the level of which is decided by you!</p>\r\n\r\n<p>Motorisation is perfect for window coverings in these areas as windows are often high and hard-to-reach, especially with skylights. Using Somfy ensures you can change the position of your blinds whenever you like, and with our automation options, you can leave your blinds to do the work for you!</p>\r\n','','basic_html'),('post',0,5,5,'en',0,'<p>The technological environment is rapidly changing every day.</p>\r\n\r\n<p>In most instances, our experience with the world is improved, but with so many websites, apps and devices, technology can also be complicated.</p>\r\n\r\n<p>Enter IFTTT, a single web-based platform that helps you do more with all your apps and devices. The tool acts as an ultimate automation service to bring all your internet-connected services together to create new experiences.</p>\r\n\r\n<p>Read on to uncover the amazing IFTTT universe and how it can help you.</p>\r\n\r\n<h2>What is it?</h2>\r\n\r\n<p>IFTTT is both a&nbsp;website and a mobile app. The acronym stands for \'If This, Then That\' and is pronounced like \'gift\' without the G. The free service launched in 2011 with the aim of \"putting the internet to work for you\". The platform allows you to connect all your \'services\' together to automatically complete tasks that might otherwise be repetitive or connect devices that might not have previously been able to talk to each other.</p>\r\n\r\n<p>Currently, IFTTT is compatible with over 600 services including Somfy\'s&nbsp;Connexoon Window RTS, giving you a complete home automation experience.</p>\r\n\r\n<h2>How does IFTTT work?</h2>\r\n\r\n<p>IFTTT uses \'applets\' to trigger actions (hence If This, Then That) to minimise your daily workflow. The applets connect multiple services, such as smart home devices, apps or websites, to run automated tasks by having some type of event in one device or service automatically trigger an action in another.</p>\r\n\r\n<p>Some examples include:</p>\r\n\r\n<ul>\r\n	<li>Turn on your outdoor lights when the pizza is on its way</li>\r\n	<li>Save photos you\'re tagged in on Facebook to an album on your phone</li>\r\n	<li>Save money when you hit your daily Fitbit step goal</li>\r\n	<li>Sync Amazon Alexa to-do with iOS reminders</li>\r\n	<li>Turn on your coffee machine when you wake up</li>\r\n	<li>Lock your door when leaving home</li>\r\n</ul>\r\n\r\n<p>With over 55 million IFTTT applets, the possibilities are endless. You can also create your own applets or make variations of existing ones.</p>\r\n\r\n<p>To get started with IFTTT, you only need to download the app, create a free account and then select the services you\'d like to connect. You\'ll be up and running with automations in minutes.</p>\r\n\r\n<h2>IFTTT and Somfy</h2>\r\n\r\n<p>With the launch of IFTTT compatibility with Somfy, your window coverings can work for you. For a completely hands-free experience, you can use your Amazon Echo or Google Home device to talk to your Connexoon Window RTS and control your window coverings or lights.</p>\r\n\r\n<p>You can ask your Google Assistant to open all your&nbsp;blinds and curtains simply by saying \"Ok Google, good morning\". Or ask Amazon Alexa to launch your movie scenario and it will lower your blinds and turn on your Phillips HUE lamps based on your scene settings on your Connexoon Window RTS app.</p>\r\n\r\n<p>Alternatively, you can set your window coverings to work automatically based on pre-set triggers. For example, using a location service, you can trigger your blinds to be lowered in preparation for your arrival home when you enter an area you have specified (e.g. 10 minutes from home or when you\'re leaving work!) Another nifty applet is when the UV index is too high, a Connexoon scenario for closing your window coverings will be triggered to keep your home cool and protect your furnishings!</p>\r\n','','basic_html'),('post',0,6,6,'en',0,'<p>The convenience of Somfy-motorised window coverings just got even simpler with IFTTT compatibility.</p>\r\n\r\n<p>Now you can control your window coverings with voice commands or set automatic actions through the IFTTT app.</p>\r\n\r\n<p>Read on to discover the opportunities of Somfy and IFTTT.</p>\r\n\r\n<h2>Voice Control</h2>\r\n\r\n<p>The exciting addition of IFTTT means you can now control your Somfy RTS products with your voice. Using your&nbsp;Connexoon Window RTS device, and your voice-controlled assistant, you can operate your window coverings and Phillips HUE lights with simple voice commands.</p>\r\n\r\n<p>Talking to either your Google Home or Amazon Echo device, you can use simple commands such as \"Alexa, trigger good morning\", \"Ok Google, good night\", \"Alexa, trigger I\'m home\" or even \"Ok Google, launch movie scenario\" to trigger actions for your Somfy-motorised window coverings.&nbsp;</p>\r\n\r\n<p>Some actions you can create are:</p>\r\n\r\n<ul>\r\n	<li>Say \"Alexa, trigger good morning\" to turn off the outdoor lights, raise the&nbsp;blinds in the bedroom but lower the blinds in the bathroom to maintain privacy.</li>\r\n	<li>Say \"Ok Google, I\'m going on vacation\" to turn on certain lights and set schedules on window coverings to mimic activity and increase&nbsp;security.</li>\r\n</ul>\r\n\r\n<p>To learn how to set up your device with IFTTT and Connexoon, download our quick start guides below:</p>\r\n\r\n<p><a href=\"https://www.somfy.com.au/au_v4/en/en-au/file.cfm?contentid=425487\"><strong>Download Amazon Echo Quick Start Guide</strong></a></p>\r\n\r\n<p><a href=\"https://www.somfy.com.au/au_v4/en/en-au/file.cfm?contentid=425486\"><strong>Download Google Home Quick Start Guide</strong></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Automation</h2>\r\n\r\n<p>You can now automate your daily routine for a complete smart home experience. The possibilities are endless and it\'s all up to you. Here are some example scenarios you can set up through IFTTT:</p>\r\n\r\n<ul>\r\n	<li>You can set&nbsp;your curtains to open at 7am every weekday to gently wake you</li>\r\n	<li>You can set your&nbsp;external venetian blinds to close every day at sunset to keep the warmth in</li>\r\n	<li>When your phone connects to your home\'s WiFi, a Connexoon scenario determined by you will be launched</li>\r\n	<li>When you leave home, all your window coverings will close for added peace of mind</li>\r\n	<li>When the UV index is too high, your window coverings will automatically close to keep your home cool and protect the furnishings inside</li>\r\n	<li>Launch a Connexoon scenario when you enter a certain area, based on geolocation</li>\r\n</ul>\r\n\r\n<p>You can use any of the pre-defined applets in IFTTT or you can create your own. Watch your home spring into action without having to lift a finger!</p>\r\n','','basic_html');
