terms if you do not agree to the new terms please stop using the service contact us if you have any questions about these terms please contact us  ',0),(2,'en','node_search',' test article test article a test article is a version of space craft or related vehicle or equipment built as a platform to perform testing test articles are built to the same specifications to replicate conditions and behaviors of flight ready versions test article version are also built without the certification and quality control steps taken with the versions intended for flight test articles are more complete than a boilerplate test articles can sometimes be upgraded to flight ready status of the 136 space shuttle external fuel tanks produced one was retained as a test article the contractor producing the tanks commented that that tank could be refurbished for flight use if necessary the static test article for the dream chaser liftingbody spaceplane will become the atmospheric flight test vehicle in 2012 for drop tests test articles are often displayed in museums because of their accuracy museums may refurbish test articles to match more modern configurations this was completed on the hubble space telescope structural dynamic test vehicle on display at the national air and space museum where this 1976 version of the vehicle was removed from display and upgraded in 1996 by the smithsonian lockheed and nasa to incorporate changes made on the onmission version of the hubble space telescope over several servicing missions test wed 11142018 948 space ',0),(3,'en','node_search',' iron man and spiderman adorn new avengers infinity war character posters iron man and spiderman adorn new avengers infinity war character posters test wed 11142018 1000 whenever any highly anticipated blockbuster is around the corner it s only expected that promotional posters be plastered in movie theaters and entertainment stores or even on social media in the case of one as huge as avengers infinity war  it comes as no surprise that the onslaught be seemingly neverending on the plus side though it gives fans a variety of options for which posters they d like to grace their own walls i mean just because you may love one piece gathering earth s mightiest heroes doesn t mean that it ll appeal to the next person or if group shots aren t quite your thing then you may dig character posters that allow each individual to have their time in the spotlight and if you are indeed of this crowd well then you ll like the latest offerings to have surfaced as marvel s now given peter parker and tony stark their own onesheets both of which can be seen in the gallery below title spiderman title iron man  ',0),(4,'en','node_search',' window coverings for your transitional spaces window coverings for your transitional spaces test thu 11152018 1001 transitional spaces in the home can be among the hardest spots to decorate and are often forgotten in terms of window coverings with so many options to choose from selecting window treatments can be a challenge different rooms call for different styles of window coverings it s not a onesize fits all approach here at somfy we pride ourselves on making your life simpler including helping you choose the right window coverings for your home with that in mind we ve created a tenpart series to help you choose the best window coverings to suit each room of your home part nine transitional spaces transitional spaces in the home can be among the hardest spots to decorate and are often forgotten in terms of window coverings if you are lucky enough to have windows in these spaces we are here to help big and wide windows in these spaces are perfect for expanding the size of the space to the eye for example windows in the hallway can dramatically open up an otherwise tight space unfortunately windows in these spaces are often left naked and bare as it can be difficult to find a solution to suit but these tricky spaces need quality window coverings as well uncovered windows leave your furnishings exposed to uv damage extreme heat or cold and consquently increased energy bills in this month s blog we look at three common transitional spaces and how you can choose window coverings to suit entryways and hallways first impressions are everything and your entryway is no exception it sets the tone for the rest of your home so you want to create a soothing and inviting atmosphere similarly a hallway should create a special moment as you are lead from one room to another the type of window treatment you should use depends on the type of window you have in this space many void spaces swap solid walls for windows which open the space and create appeal by taking advantage of the view outside this presents an insulation problem as heat can escape in the winter and enter the home during the summer sidelight windows beautifully complement your entryway but extend a lack of privacy with nosy neighbours able to peek inside your home in this space sheer treatments can combat the problems offering light control and privacy without completely blocking the sun additionally if the windows in your entryway sit above the door motorised blinds are the optimal solution with the ability to control them from wherever you are in the world stairwell voids in stairwells open the home to a flood of natural light they are particularly useful in areas of the home which may otherwise be lacking light large windows in voids can create a dramatic focal point and effortlessly enhance the space however uncovered windows can create heat pockets on your stairway during summer and cold during winter which will have your heating cooling system working overime in this space external venetian blinds are a great solution having a major impact on the temperature loss gain motorised external venetians allow you to precisely control the amount of sunlight coming in and reducing glare venetians are also a good option for privacy protection as the slats can be angled to prevent people from seeing in  skylights skylights provide spectacular views and an abundance of natural light while also adding a magical design element to your home they are a sleek way to open up a space but can be a source of unwanted heat excessive heat gain in summer and glare can be major problems leaving you wishing you could turn your skylights off they can also pose tricky problems for window coverings due to their location shape and angle however it is easy to enjoy benefits of skylights all year round with external blinds external blinds allow you to control the amount of light coming in and the temperature of your room all while reducing energy consumption and costs most importantly external blinds block the elements before they reach the window don t worry this doesn t mean you will have to climb up on your roof to close the blind somfy motorisation means you can control your blinds using a remote sensors timers a smartphone app or even your voice  recommendations windows in transitional spaces are the ultimate way to elevate dark interiors however it is important to provide insulation with window treatments to avoid precious heat loss or unwanted heat gain roller blinds or venetian blinds are great options for these transitional spaces allowing you to maintain a steady flow of light the level of which is decided by you motorisation is perfect for window coverings in these areas as windows are often high and hardtoreach especially with skylights using somfy ensures you can change the position of your blinds whenever you like and with our automation options you can leave your blinds to do the work for you  ',0),(5,'en','node_search',' what is ifttt  what is ifttt test thu 11152018 1006 the technological environment is rapidly changing every day in most instances our experience with the world is improved but with so many websites apps and devices technology can also be complicated enter ifttt a single webbased platform that helps you do more with all your apps and devices the tool acts as an ultimate automation service to bring all your internetconnected services together to create new experiences read on to uncover the amazing ifttt universe and how it can help you what is it  ifttt is both a website and a mobile app the acronym stands for if this then that and is pronounced like gift without the g the free service launched in 2011 with the aim of putting the internet to work for you the platform allows you to connect all your services together to automatically complete tasks that might otherwise be repetitive or connect devices that might not have previously been able to talk to each other currently ifttt is compatible with over 600 services including somfy s connexoon window rts giving you a complete home automation experience how does ifttt work  ifttt uses applets to trigger actions hence if this then that to minimise your daily workflow the applets connect multiple services such as smart home devices apps or websites to run automated tasks by having some type of event in one device or service automatically trigger an action in another some examples include turn on your outdoor lights when the pizza is on its way save photos you re tagged in on facebook to an album on your phone save money when you hit your daily fitbit step goal sync amazon alexa todo with ios reminders turn on your coffee machine when you wake up lock your door when leaving home with over 55 million ifttt applets the possibilities are endless you can also create your own applets or make variations of existing ones to get started with ifttt you only need to download the app create a free account and then select the services you d like to connect you ll be up and running with automations in minutes ifttt and somfy with the launch of ifttt compatibility with somfy your window coverings can work for you for a completely handsfree experience you can use your amazon echo or google home device to talk to your connexoon window rts and control your window coverings or lights you can ask your google assistant to open all your blinds and curtains simply by saying ok google good morning or ask amazon alexa to launch your movie scenario and it will lower your blinds and turn on your phillips hue lamps based on your scene settings on your connexoon window rts app alternatively you can set your window coverings to work automatically based on preset triggers for example using a location service you can trigger your blinds to be lowered in preparation for your arrival home when you enter an area you have specified eg 10 minutes from home or when you re leaving work another nifty applet is when the uv index is too high a connexoon scenario for closing your window coverings will be triggered to keep your home cool and protect your furnishings  ',0),(6,'en','node_search',' discover voice control with somfy and ifttt discover voice control with somfy and ifttt test thu 11152018 1007 the convenience of somfymotorised window coverings just got even simpler with ifttt compatibility now you can control your window coverings with voice commands or set automatic actions through the ifttt app read on to discover the opportunities of somfy and ifttt voice control the exciting addition of ifttt means you can now control your somfy rts products with your voice using your connexoon window rts device and your voicecontrolled assistant you can operate your window coverings and phillips hue lights with simple voice commands talking to either your google home or amazon echo device you can use simple commands such as alexa trigger good morning ok google good night alexa trigger i m home or even ok google launch movie scenario to trigger actions for your somfymotorised window coverings some actions you can create are say alexa trigger good morning to turn off the outdoor lights raise the blinds in the bedroom but lower the blinds in the bathroom to maintain privacy say ok google i m going on vacation to turn on certain lights and set schedules on window coverings to mimic activity and increase security to learn how to set up your device with ifttt and connexoon download our quick start guides below  download amazon echo quick start guide download google home quick start guide   automation you can now automate your daily routine for a complete smart home experience the possibilities are endless and it s all up to you here are some example scenarios you can set up through ifttt you can set your curtains to open at 7am every weekday to gently wake you you can set your external venetian blinds to close every day at sunset to keep the warmth in when your phone connects to your home s wifi a connexoon scenario determined by you will be launched when you leave home all your window coverings will close for added peace of mind when the uv index is too high your window coverings will automatically close to keep your home cool and protect the furnishings inside launch a connexoon scenario when you enter a certain area based on geolocation you can use any of the predefined applets in ifttt or you can create your own watch your home spring into action without having to lift a finger  ',0);
